import React from 'react';
import {Nav, Navbar} from 'react-bootstrap';

const NavBar =() => (
    <header className="mb-auto">
        <div>
          <h3 className="float-md-start mb-0">Cover</h3>
<Navbar>
<Nav className="navbar navbar-dark bg-dark">
            <Nav.Link className="nav-link active" aria-current="page" href="#">Home</Nav.Link>
            <Nav.Link className="nav-link" href="#">Features</Nav.Link>
            <Nav.Link className="nav-link" href="#">Contact</Nav.Link>
</Nav>
</Navbar>
</div>
    </header>);

export default NavBar;
